import React from "react";
import styled from "styled-components";
import { Card } from "styled-components"

const CollectionsPageDiv = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  background-color: #2ff;

  margin: 10px;
`;

const SidebarDiv = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  background-color: #7fff00;
  align-items: center;

  width: 15%;
  height: 100%;

  border: 5px solid #ff0000;
  border-radius: 10px;

  margin: 20px;
`;

const Content = styled.div`
  display: flex;
  flex-direction: column;
  background-color: #0f6cfc;

  width: 80%;
`;

const Table = styled.div`
    display: flex;
`;

const CustomCard = styled(Card)`
  display: flex;
  flex-direction: column;
  overflow-y: scroll;
  gap: 15px;
  padding: 15px;
  width: 170px;
  height: 250px;
  background: #2e2e2e !important;

  img {
    width: 170px;
    height: 170px;
    border-radius: 4px;
  }

  > div {
    display: flex;
    flex-direction: column;
    gap: 10px;
  }

  h5 {
    color: #ffffff;
  }

  h6 {
    font-weight: 300;
    color: #878787;

    overflow: hidden;
    // text-overflow: ellipsis; gerek yok?
    line-height: 1.5em;
    max-height: 3em;
  }
`;

const Collections: React.FC = () => {
  return (
    <CollectionsPageDiv>
      <SidebarDiv>
        <div>
          <h3>Filter 1</h3>
          <ul>
            <li>Item 1</li>
            <li>Item 2</li>
            <li>Item 3</li>
          </ul>
        </div>

        <div>
          <h3>Filter 2</h3>
          <ul>
            <li>Item 1</li>
            <li>Item 2</li>
          </ul>
        </div>

        <div>
          <h3>Filter 3</h3>
          <ul>
            <li>Item 1</li>
            <li>Item 2</li>
          </ul>
        </div>
      </SidebarDiv>

      <Content>
          <h2>
              Products
          </h2>
          <Table>

          </Table>
      </Content>
    </CollectionsPageDiv>
  );
};

export default Collections;
